Attachment (Top):1/4'' screw attachment type<br>Color:Black<br>Front Tilt:-35° / +35° tilt range<br>Material:Adapto + stainless steel<br>Panoramic Rotation:360° degrees<br>Closed Length:7.28'' (18.5cm)<br>Load Capacity:2.2 lbs (1kg)<br>Maximum Height:5.31'' (13.5cm)<br>Minimum Height:5.31'' (13.5cm)<br>Weight:0.51 lbs (0.23kg)<br><br><br>・<b>Stable and Ergonomic Grip: </b> PIXI provides a secure base in every situation. Stability is indispensable when creating excellent images  especially for landscapes  night photography and self-portraits. This tripod helps you to take sharper images while also functioning as an ergonomic grip to produce great videos from different perspectives.<br>・<b>Intuitive and Fast: </b> The new push-button mechanism enables you to position and lock the ball head in one rapid movement. Pushing the button releases the ball joint to move freely so you can position your subject correctly in the frame. When the button is released  the ball is locked automatically in the selected position.<br>・<b>Universal and portable: </b> Thanks to the universal 1/4'' screw thread and the excellent stability  PIXI can be used with a huge variety of digital devices  compact cameras  CSC's and entry level DSLR's and the Manfrotto KLYP Case for iPhones.<br>・<b>High stbility: </b> The stability with a DSLR is limited by the weight of the camera (maximum body weight of 1.4lbs and maximum focal length of 85mm). The PIXI weighs 8 oz and has a height of 5 inches when legs are opened and 7 inches when closed.<br><br><br>The Manfrotto PIXI is the perfect mini tripod for Compact System Cameras (CSC). It has been designed to satisfy the needs of those consumers that are looking for a support that is lightweight  portable and easy to use. <br><br> The PIXI is great for achieving hard to get video shots while keeping your camera steady. Close the legs to use it as a comfortable grip to capture great videos that stand out from the crowd. <br><br> The new push-button mechanism enables you to position and lock the ball head in one rapid  intuitive movement. Pushing the button releases the ball joint to move freely. When the button is released  the ball is locked automatically in the selected position. <br><br> PIXI has a minimal Italian style and is manufactured from stainless steel and Adapto for high quality and a tactile finish. With this solid construction  it provides a secure base in every situation and the rubber feet guarantee a stable and slip-free purchase on any surface. <br><br> <b> DSLR Compatibility </b> <br> Thanks to the universal 1/4 screw thread and the excellent stability  PIXI can be used with a huge variety of digital devices  the iPhone (with KLYP)  compact cameras  CSC's and even entry level DSLRs. <br><br> PIXI has been developed for entry level DSLRs fitting these basic requirements: <br><br> &bull  Body: maximum weight of 650g/1.4lbs <br> &bull  Focal length: maximum 85mm (standard non professional lens) <br> &bull  Total equipment payload: maximum 1kg/2.2lbs <br><br> Please consider that any semi-professional and professional equipment exceeds these requirements.<br><br></DIV>
