Load Capacity:110 lbs (50 kg)<br>Diameter/Thread:Flat Mitchell base<br>Counter Balance System:4 steps + 0<br>Counter Balance Range:0-110 lb (50 kg)<br>Quick Release/Wedge Plate:Yes<br>Balance Plate:Yes<br>Tilt Drag:7 steps + 0<br>Tilt Range:±65°<br>Tilt Lock:Yes<br>Pan Drag:7 steps + 0<br>Pan Range:360°<br>Pan Lock:Yes<br>Leveling Bubble/Illuminated:Yes / Yes<br>Temperature Range:-40 to +158°F (-40 to +60°C)<br>Weight:24 lbs (11 kg)<br>Warranty:Cartoni warranty<br><br><br>・For Studio/OB configurations weighing up to 110 lbs (50 Kg)<br>・7 Levels of fluid drag plus zero for whip pans<br>・Illuminated spirit level<br><br><br>The Cartoni C60S Fluid Head is a heavy duty fluid head specifically designed to support film and studio cameras weighing up to 110 lb (50 kg). The counterbalance mechanism is activated by an 5-position easy grip selector  while the fluid control system allows the damping levels to range from 0 for free wheeling to 5 for maximum drag on both pan and tilt modes. <br><br>Standard features include the quick release camera plate with safety lock  two adaptable telescopic pan bars and an illuminated spirit level. The head comes equipped with a flat Mitchell base and options include a 150 mm bowl base and an eyepiece extension holder.<br><br></DIV>
