Mounting thread:1/4''-20 and 3/8''-16<br>Clamp Size:60 mm<br><br><br>The ProMediaGear C60 Arca-Swiss Compatible Quick Release Clamp 1/4''-20 and 3/8''-16 mounting threads included cut in steel  nickel-chrome plated insert  this ensures that threads will remain in good condition almost indefinitely  as opposed to all other designs that have threads cut directly in the aluminum body of the clamp  rending it useless once the threads wear out in the aluminum.<br><br>It also allows you to upgrade to a different thread if you happen to change your tripod  no need to buy a new clamp. Hard black anodized surface coating with matte non reflective and wear resistant finish. Features self retaining  nickel-chrome plated knob for added durability and looks<br><br></DIV>
