Head Type:Fluid Ball Head<br>Quick Release:QS-39 plate with 1/4''-20 thread<br>Head Height:4-3/8''<br>Material:Exterior Construction: Magnesium exterior<br>Weight:26.5 oz<br>Other:Swivel 360°<br>Bubble Level(s):Two<br>Other:Dual Knob Locking Mechanisms<br>Pan/Tilt Drag:Tilt: -35° ~ +90°<br>Head Load Capacity:44 lb /19.6 kg<br>Color:Black<br>Warranty:Vanguard Lifetime Warranty<br><br><br>・Cutting-edge ball head technology<br>・Single-piece Ball Unit Technology - ball and stem make one solid milled piece-provides greater integrity to hold an outstanding loading weight  resists wear and tear from demanding daily use<br>・Designed to prevent minor/major movements and reduces camera vibration<br>・Constructed magnesium ball head<br>・Sliding quick shoe<br>・Sturdy and reliable with an impressive light weight<br>・Advanced Magnesium Housing System-couples a rugged magnesium exterior with a hollow interior  providing all of the precise  fluid-like movement of a standard fluid ball head  minus the weight<br>・Bubble level - 2 large built-in bubble levels. Couple the double vertical andhorizontal balance/stability control with your tripod's bubble level and you can't get more stable<br>・Double locking system-ensuring maximizing security.<br>・2 separate mechanisms are simultaneously triggered to release the quick shoe  this ensures that your camera and lenses never fall<br>・Panoramic Function - horizontal control that enables you to take incredible panoramic shots with smooth  full 360-degree movement<br><br><br><br><br>The Vanguard SBH-250 is commonly used for  Home  Landscape/scenery  Night shots  Portraits  Sports/action  Travel  Video  Weddings  Wildlife and more.The Vanguard SBH-250 is most used by customers who consider themselves to be a  Photo enthusiast among others.The Vanguard SBH-250 is popular because customers like the following qualities of the Vanguard SBH-250:  Attaches firmly  Large range of motion  Stable and Strong clamp.</DIV>
